        return new Source("{% extends 'admin.html.twig' %}

{% block title %}Job Express::Category{% endblock %}

{% block body %}
    <div class=\"col-md-6\">
        <h1 class=\"text-info\">Category List</h1>
    </div>
    <div class=\"col-md-6\">
        <a href=\"{{ path('category_new') }}\" class=\"btn btn-default btn-warning float-right\"> <i class=\"fa fa-plus\"></i> Create new</a>
    </div>
    <table class=\"table table-hover table-bordered\">
        <thead class=\"bg-success\">
            <tr>
                <th>Id</th>
                <th>Name</th>
                <th>Status</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for category in categories %}
            <tr>
                <td>{{ category.id }}</td>
                <td>{{ category.name }}</td>
                <td>{{ getStatus[category.status] }}</td>
                <td>
                    <a href=\"{{ path('category_show', {'id': category.id}) }}\" class=\"text-info\"> <i class=\"fa fa-eye\"></i> show</a> |
                    <a href=\"{{ path('category_edit', {'id': category.id}) }}\" class=\"text-warning\"> <i class=\"fa fa-edit\"></i> edit</a> 
                    {% if is_granted('ROLE_ADMIN') %}
                       | <a href=\"{{ path('category_edit', {'id': category.id}) }}\" class=\"text-danger\"> <i class=\"fa fa-trash\"></i> delete</a>
                    {% endif %}
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"8\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>
{% endblock %}
", "category/index.html.twig", "D:\\xampp\\htdocs\\symfony_job_express\\templates\\category\\index.html.twig");
